import React from "react";

const Footer = () => {
  return (
    <>
      <footer id="footer">
        <div className="container">
          <a
            href="https://github.com/amitgupta9977/ShoppingCart"
            className="repo_link"
            target="_blank"
            rel="noreferrer"
          >
            github.com/amitgupta9977/ShoppingCart
          </a>
        </div>
      </footer>
    </>
  );
};

export default Footer;
